
DROP TABLE IF EXISTS `gIngredients`;
CREATE TABLE gIngredients (entity int not null AUTO_INCREMENT ,owner char(255),recipename char(255),atten float ,qty float ,originalqty float ,ingredient char(255),ingredientType char(255),isAdjunct int ,isPrimingFalvouring int ,mustMash int ,isGrain int ,hwe float ,extract float ,unit char(255),hopAlpha float ,hopForm char(255),hopUse char(255),hopAddAt float ,colour float ,processIngredient int ,processConsumable int ,process char(255),category char(255), PRIMARY KEY(entity) );
